syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "ProfilePicture.proto";

// Name: IFDALNKLGJA
message FleurFairPlayerStatInfo {
    ProfilePicture profile_picture = 11;
    string online_id = 2;
    uint32 head_image = 14;
    string nick_name = 13;
    uint32 uid = 12;
    int32 param = 4;
    uint32 stat_id = 1;
}

